name: Returns 200
code: |+
  const response= await insomnia.send();

  expect(response.status).to.be.oneOf([200,202,403,409]);

  let body =JSON.parse(response.data)
  switch(response.status){
  	case 200:
  		expect(body).to.NaN();
  		break;
  	case 202:
  		expect(body).to.be.NaN();
  		break;
  	case 403:
  		expect(body).to.be('CodeErro');
  		break;
  	case 409:
  		expect(body).to.be.NaN();
  		break;
  }

